import React from 'react';

var menuMargin = {
    marginLeft: '5%'
};

var titleStyle = {
    textAlign: 'left',
    paddingTop: '20px'
}

var menuItemStyle = {
    textAlign: 'left',
    padding: '10px'
}

var alignLeft = {
    textAlign: 'left'
}

var redLineStyle = {
    background: '#d43031',
    width: '60px',
    height: '2px'
};

function MenuItems() {
  return (
    <table width='800px' style={menuMargin}>
        <tr>
            <td style={titleStyle}>
                <h3>Mittwoch
                    <div style={redLineStyle}></div>
                </h3>
            </td>
        </tr>

        <tr>
            <td style={menuItemStyle}>
                <span>Sloppy Joe mit Fries or Soup or Salad</span> <br/>
                <span>Curry Chicken mit Reis und Veggies</span>
            </td>
            <td style={alignLeft}>
                <span>Spinach, Mushroom & Barley</span> <br/>
                <span>Tomato, Corn & Black Beans</span>
            </td>
        </tr>
    </table>
  );
}

export default MenuItems;
